pragma solidity 0.5.11;
pragma experimental ABIEncoderV2;

import "openzeppelin-solidity/contracts/math/SafeMath.sol";
import "./IDeposit.sol";


contract BatchDeposit_Goerli {
    using SafeMath for uint256;

    address constant DEPOSIT_CONTRACT_ADDRESS = 0x5cA1e00004366Ac85f492887AAab12d0e6418876;
    uint256 constant DEPOSIT_AMOUNT = 32 ether;
    IDeposit constant DEPOSIT_CONTRACT = IDeposit(DEPOSIT_CONTRACT_ADDRESS);

    constructor() public {}

    function batchDeposit(
        bytes[] calldata pubkeys,
        bytes[] calldata withdrawal_credentials,
        bytes[] calldata signatures,
        bytes32[] calldata deposit_data_roots
    ) external payable {
        require(
            pubkeys.length == withdrawal_credentials.length &&
            pubkeys.length == signatures.length &&
            pubkeys.length == deposit_data_roots.length,
            "All of the parameters needs to have the same lengths of arrays"
        );
        require(pubkeys.length != 0, "Parameters arrays cannot be empty");
        require(msg.value >= DEPOSIT_AMOUNT.mul(pubkeys.length),"Sent ether needs to be equal to 32 * dataâ€™s length");
        uint256 deposited = 0;
        for (uint256 i = 0; i < pubkeys.length; i++) {
            DEPOSIT_CONTRACT.deposit.value(DEPOSIT_AMOUNT)(
                pubkeys[i],
                withdrawal_credentials[i],
                signatures[i],
                deposit_data_roots[i]
            );
            deposited = deposited.add(DEPOSIT_AMOUNT);
        }
        assert(deposited == DEPOSIT_AMOUNT.mul(pubkeys.length));
        emit BatchDepositEnded(true);
        uint256 ethToReturn = msg.value.sub(deposited);
        if (ethToReturn > 0) {
            (bool success, ) = msg.sender.call.value(ethToReturn)("");
            require(success, "transfer of remaining funds failed");
            emit LogSendDepositLeftover(msg.sender, ethToReturn);
        }
    }

    function() external payable {
        require(
            msg.data.length == 0,
            "msg.data needs to be empty when calling fallback function"
        );
        revert("To send ether to this contract, use batchDeposit function.");
    }

    event LogSendDepositLeftover(address from, uint256 amount);
    event BatchDepositEnded(bool);
}
